import React from 'react';
import Breadcrumbs from '../components/Breadcrumbs';
import SecBestFeatures from '../components/SecBestFeatures';
import { Container, Row, Col } from 'react-bootstrap';
import SecVideo from '../components/SecVideo';
import LoginComponent from "../components/LoginComponent";

function Dashboard() {
    return (
        <Container>
            <>
                <Row className="row align-items-center d-flex pt-5 mt-5">
                    <Col lg={12} sm={12} className="form_col pt-5 mt-5">
                        <section className="OurBestPlatform">
                            <p>You Are Logged In.</p>
                        </section>
                    </Col>
                </Row>
            </>
        </Container>
    );
}

export default Dashboard;
